import React, {Component} from 'react';
import axios from "axios";

class App extends Component {
    get_data=()=>{
        axios.get('http://127.0.0.1:8000/server')
    }
    render() {
        return (
            <div>
                <button onClick={this.get_data}>点我获取数据</button>
            </div>
        );
    }
}

export default App;
